import React from 'react';
import { View, Text, TextInput, StyleSheet } from 'react-native';

const customInput = () => {
	return (
		<View>
		<TextInput placeholder="placeholder" />
		</View>
	);
}

const styles = StyleSheet.create({
input: {
		paddingVertical: 15,
		paddingHorizontal: 15,
		backgroundColor: '#fff',
		borderRadius: 60,
		borderColor: '#ffd500',
		borderWidth: 1,
		width: 250,
	},
});

export default customInput
